function App() {
  const expenses = [
    { title: "Car Expenses", amount: 294.67, date: new Date(2021, 2, 8) },
    { title: "Car Expenses", amount: 294.67, date: new Date(2021, 2, 8) },
    { title: "Car Expenses", amount: 294.67, date: new Date(2021, 2, 8) },
    { title: "Car Expenses", amount: 294.67, date: new Date(2021, 2, 8) },
    {},
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
